    [],nt"revision_timestamp": "2016-07-27T23:01:32.446380",nt"name": "north-american-breeding-bird-survey",nt"isopen":
    false,nt"url": null,nt"notes": "This protocol framework provides guidance
    for conducting surveys of North American bird populations at multiple stations within
    two or more regions. The BBS is a cooperative effort between the U.S. Geological
    Survey's Patuxent Wildlife Research Center and Environment Canada's Canadian Wildlife
    Service to monitor the status and trends of North American bird populations. Following
    a rigorous protocol, BBS data are collected by thousands of dedicated participants
    along thousands of randomly established roadside routes throughout the continent.
    Professional BBS coordinators and data managers work closely with researchers and
    statisticians to compile and deliver these population data and population trend
    analyses on more than 400 bird species, for use by conservation managers, scientists,
    and the general public.",nt"license_title": "License Not Specified",nt"extras":
